import "./NavHome.css";
const NavHome = () => {
  return (
    <div className="navhome">
      <a className="anchor-home" href="google.com">
        <a className="title" href="http://localhost:3000/"><h1>AccessiLaw </h1></a>
      </a>
    </div>
  );
};

export default NavHome;
